import React from 'react';
import { Card,Row } from 'antd';

const Home = () => {
    const dummy = [
        {
            title: "DSM공모전",
            admin: "김주성",
            body: "공모전을 위한 클래스"
        }
    ]
    return (
        <div>
            <Row gutter={16}>
                {
                    dummy.map(v => {
                        console.log(v)
                    })
                }
            </Row>
            <Card title={dummy[0].title}>{dummy[0].body}</Card>
        </div>
    )
}

export default Home;
